{"query":"fragment Tournament on Tournament {
  sys {
    publishedAt
  }
  coverImage {
    url
  }
  title
  date
  badge
  callToActionButtonLabel
  callToActionButtonLink
  featured
  description {
    json
  }
}

fragment TournamentCollection on TournamentCollection {
  total
  items {
    ...Tournament
  }
}

query tournaments(
  $isFeatured: Boolean
  $dateGte: DateTime
  $isPreview: Boolean = false
) {
  tournamentCollection(
    where: { featured: $isFeatured, date_gte: $dateGte }
    order: [date_DESC]
    preview: $isPreview
  ) {
    ...TournamentCollection
  }
}
","variables":{"isFeatured":false,"dateGte":"2021-11-01","isPreview":true},"operationName":"tournaments"}

